INSERT INTO `board` VALUES (3343,'<p>브라질 지금 잘나가는 선수 누구 있음? 옛날에 영광에서 빠져 나와야 됨</p>','2022-11-17 10:09:27.063480','브라질은 우승못함',2,NULL,NULL,6),(3344,'<p><strong>나폴리 선발 라이업</strong></p><figure class=\"image\"><img src=\"https://s3.ap-northeast-2.amazonaws.com/k7a203-ckeditor-image-upload/81dfbc35fff2424fb51b9e8c6b86ca57.png\"></figure><p>&nbsp;</p><p>&nbsp;</p>','2022-11-17 10:13:24.546024','나폴리 VS 엠폴리 나폴리 선발라인업 떴다!',2,NULL,NULL,5),(3345,'<figure class=\"image\"><img src=\"https://image5jvqbd.fmkorea.com/files/attach/new3/20221117/33854530/4374464968/5223503570/4b3433f946e7493260083cf3c0606aa8.png\" alt=\"image.png 22/23 시즌 PL 미드필더 전진패스 지표\"></figure>','2022-11-17 10:23:50.837758','22/23 시즌 PL 미드필더 전진패스 지표',2,NULL,NULL,16),(3346,'<p>첼 토 아 탈락했고 4라운드 대진도 리버풀이랑 맨시티 맞대결이라 둘 중 하나는 또 떨어짐</p><p>우리가 챔피언쉽 1위 번리 만났다고 해도 2부와 1부의 차이는 엄연히 존재할 수 밖에 없고 심지어 경기도 오티에서 열림</p><p>리그 우승은 아스날이랑 승점차 4~5점 정도 좁히지 않는 이상 지금 논할 단계는 아니고 못하는게 정배같음 유로파는 바르사를 잡는게 좀…</p><p><br><img src=\"https://image5jvqbd.fmkorea.com/files/attach/new3/20221117/33854530/4905257163/5223515387/64324f3863f7aad2ad73ea342a947971.jpeg\" alt=\"A36892EA-0BB0-4EA3-9EB9-6325614A8D03.jpeg 올시즌 리그컵은 우승해볼만 하지않음?\"></p><p>이게 리그컵 4라운드 대진인데 이거 우승 못하면 뭐랄까 우리 스스로 깊이 반성해야할 것 같음 그 다음 남은게 FA컵 하나인데 FA컵은 대진 나오면 나중에 논하기로 하고 올시즌도 무관엔딩은 좀 피해야 내년에 벨링엄이든 누구든 노릴 때 가산점이 붙지않을까 싶음</p>','2022-11-17 10:34:58.476932','올시즌 리그컵은 우승해볼만 하지않음?',3,NULL,3100,16),(3347,'<p><strong>rnardo Silva:</strong></p><p><br>&nbsp;</p><p><strong>\"I will fight for Cristiano at the World Cup, not for myself.\"</strong></p><p><br><br>&nbsp;</p><p><strong>베르나르두 실바: 나를 위해서가 아니다. 월드컵에서 GOAT를 위해 싸울 것 이다.</strong></p><p><br><img src=\"https://s3.ap-northeast-2.amazonaws.com/k7a203-ckeditor-image-upload/9dfc42752e704f1f8881f0a54e8745d3.jpg\"></p><p>&nbsp;</p><p><strong>역사상 최고, GOAT</strong></p>','2022-11-17 10:42:38.490059','베르나르두 실바 : 월드컵은 오직 GOAT를 위해서 뛸 거다',2,NULL,NULL,6),(3348,'<p>무엇인가 변해야 한다.</p>','2022-11-18 10:34:30.846243','울버햄튼은 이대로 안된다.',3,NULL,3077,5),(3449,'test','2022-11-